var _story_ = {
    "1410": [
        {
            "_id": 1,
            "Story": "Styxia, the coastal city of intoxication and dreams, where echoes of old songs still drift among the waves.<br>Helektra, Daughter of the Sea, Chrysos Heir who cleanses the Ocean's Coreflame, dispels the murky undercurrents and orchestrates a banquet of revelry for the heroes beyond the sky.<br>The show must go on. Even if hope is as fragile as bubbles, the waves will keep surging forward."
        },
        {
            "_id": 2,
            "Story": "When sunlight filtered down through the surface, the sea's breath shimmered with a kaleidoscope of colors. That was the merriest time of day for the sirens.<br><i>\" Plop \" \" Pika \" \" Bo-pom \"</i><br>The siren princess chased bubbles in delight. Her favorite moment was when one paused on her nose, just before it popped and rippled a burst of color across the water.<br><br>Amid coral stretching for miles, the sea sirens sang. The pearls there sparkled like stars, perfect ornaments for a bowstring.<br>Music flowed from Helektra's fingers like a gentle current, brushing past companions basking in the joy of honey brew.<br><br><i>\" Look, on that bright and bustling ship, how happy the humans must be. \"<br>\" You long for the one you saved as his voice still echoes in your soul. \"<br>\" Noble princess, carefree Helektra, where will you go? To the frigid northern sea, or the boundless world of men? \"</i><br><br>The drunken sirens gathered around her, curiosity swaying and curling like seaweed.<br><i>\" The world above is loud, the pole too cold... \"</i><br>She brushed a bubble and shook her head with a smile:<br><i>\" I'll stay where songs still carry... \"</i><br><br>But soon, a horn of warning echoed from the deep, cutting the revelry short.<br>The sirens followed Helektra into the depths, as the Queen of the Ocean addressed her people...<br><br><i>\" Dark tides will taint our crystal currents, so we shall summon the sacred waves, draw the filth into the Grand Chalice, until Strife shines back against the black tide... \"<br>\" Children of the sea, have you chosen your course? When the black tide recedes, go to Styxia. There, people on the land will raise their glasses in your honor! \"</i><br><br>Day after day, Helektra led the sirens through the darkening sea, washing away the corrupted undercurrents.<br><br><i>\" Don't give up, my friends, not until we've drowned ourselves in triumph. \"<br>\" Don't forget, my friends, we'll swim toward the distant place. \"<br>\" Onward, my friends, vibrant hope is stirring the air. \"</i><br><br>And day after day, Helektra sang. As a Titankin, she knew guarding these waters was the fate written into her very soul...<br><br>Helektra dove into the abyss, her song fading until it became the lone light left in the dark ocean."
        },
        {
            "_id": 3,
            "Story": "The once-lush coral reef had become a graveyard of lifeless stone.<br><br>The first time she drove her blade into the Black Tide Creature, her hands trembled ever so slightly.<br>The hundredth time she faced a corrupted former friend, her dull strings could slice through flesh without hesitation.<br>The thousandth, the ten thousandth... Pearls from her instrument scattered over the sea, and the deep water had turned to blood...<br><br>In the silent ruins of that forgotten palace, only Helektra remained at her solitary feast.<br><br><i>\" The people on the land will throw feasts that never end, to honor our sacrifice... \"</i><br>The mournful song echoed through the sea as the Titan of Strife took up the fight against black tide. And for the first time, Helektra rose from the dark waters with joy in her heart.<br><br>She adorned her face with pearls. Her tail split into legs. The seafoam on her body became a gown. The crashing tide no longer roared over her head, but whimpered beneath her feet.<br>Seabirds cried overhead in chilling tones. The waves stilled for a moment, then rolled away again.<br>As if the dream had popped like a bubble and never truly existed.<br>She bore each step toward the Promised Land of Styxia with searing pain, like walking on knives...<br><br>The land reeked of pungent air as corpses piled high. Conflict and fire ravaged every corner... But the feast promised by the gods was nowhere to be found.<br><br><i>\"I... Hy...si...\"</i><br>Her voice rasped in the polluted air.<br>She had tried to learn the language of humans, but their noisy, jagged words made it impossible to sing as she once did. So, she slowly chose silence over speech.<br>\"A blade that would never rust,\" \"A melody of cruelty\"... What accompanied her day after day were the twangs that pierced flesh, and the cries of lives bleeding out...<br><br>They said the swordmaster from the sea could play like no other, yet she stayed distant and mute, never revealing what lay in her heart.<br>She had seen many hands reach out to her. Some sought to erase her, others offered help. They had lit one flame after another, only to let each flicker out.<br><br><i>\"Hysilens, where are you headed?\"</i><br><br>She couldn't answer.<br>Her old instrument had long become two blades, with only sharp requiems now echoing from the strings.<br>She had once wished someone might understand the longing within her song, but came to realize that the human world was no different from the lonely deep sea.<br>Everyone was just another lost fish, blindly swimming toward the light."
        },
        {
            "_id": 4,
            "Story": "<i>\"Hysilens, follow me. I will grant you everything you seek.\"</i><br>The voice, loud and clear despite the small frame it came from, left a deep impression. But doubt lingered in her heart:<br><i>\"And when... will her light go out?\"</i><br><br>But this flame burned like sunlight piercing the deep sea, brighter and steadier with every passing moment.<br>She watched the blue blaze fight battle after battle, always emerging victorious. She saw waves rise like wildfire, saw the Gladius roar through wind and sea, swallowing every storm of carnage like a whale shark.<br>She heard the thundering heartbeat, the pounding drums of war, the footsteps like falling rain, the sorrow swelling like a tide. The pure, song-like voice of the heart flowed through the blood of the Chrysos Heir, stirring the long-sealed strings in her mind.<br><br>The feast Imperator had promised was drawing near. Young weaver whispered to the children at their side, wondering aloud if the cold, distant Gladius would grace them with her presence.<br>Amidst the crowd's exclamations, the weaver rose on her tiptoes, holding her breath to capture the moment in full.<br>Her gown, gilded and flowing, brushed the tiles like sunlight glinting on waves.<br>And under candlelight and silver lanterns, people saw again the shimmer of the sea.<br><br>\"She answered my wish and sang to us of the sea bays the world had long forgotten.\"<br>When the monarch finished speaking, the orchestra lit up. Light and shadows danced before her eyes, rippling like waves.<br>Music rose with the bubbles in their cups, and in the swell of the crowd, she found her voice was no longer echoing in vain.<br><br>The duel between Labienus and Seneca struck like crisp drumbeats. Verginia's hidden meanings pulsed through her verses.<br>Tribios laughed, and the music gained a playful countermelody. Aglaea leapt into motion, her dance steps weaving the perfect harmony...<br><br><i>\"After this battle is won, Dux Gladiorum, is there anything you desire?\"</i><br>Even the composed monarch seemed slightly tipsy.<br>She took a sip of honey brew, whispering to the monarch, her laughter dancing in the corner of the banquet.<br>How bright it was here. How lovely it sounded.<br>The world spun on, with the clink of glasses, the soft rattle of ice.<br>The long-silent siren sang again, her voice spilling like the honey brew...<br><br><i>\" The candlelight burns so bright at this feast.<br>A brand-new sea.<br>It sways between the clinking of our cups... \"</i>"
        },
        {
            "_id": 5,
            "Story": "She had once believed the Flame-Chase was the eternal celebration she had always searched for.<br>But as the journey wore on and more was lost, even that shining light shattered like seafoam.<br><br>She had been the Imperator's sharpest blade, her sword always flowing with blood.<br>But when the Imperator's molten gold blood dripped onto her fingertips, she suddenly felt herself sinking again back into that lonely, silent sea.<br><i>\"Heh, why... did I snuff out the very flame I swam toward with my own hand...\"</i><br>For a thousand painful years, she had fled from those dazzling bubbles of memory, but now those long-burst fragments clung to her like swaying seaweed, impossible to shake loose.<br><br><i>\"Click.\"</i><br>A chess piece lands on the board. Despite her perfect composure, the sovereign's crown of flames reveals what she won't, dancing between serenity and fierce intensity.<br><i>\"I never learned how to play.\"<br>\"Then I'll teach you.\"</i><br>She picks up a piece with unpracticed fingers. Just another battleground, she thinks to herself.<br><br><i>\"Click.\"</i><br>Suddenly, vibrant blue flames warm the air around her like hot springs. She moves chess pieces without much thought and asks:<br><i>\"If they're bound to disappear from the board, why bother moving forward at all?\"</i><br><br><i>\"Click.\"</i><br>The sovereign takes a sip of honey brew, stretches her arms with satisfaction, and sighs with pleasure:<br><i>\"Isn't the journey forward fulfilling enough on its own?\"</i><br>...<br><br>After a millennium of waiting, she forged new paths for the Flame-Chase, though she knew they wouldn't be the final destination.<br><i>\"What a fish truly needs is simply a sea to call home...\"</i><br>As a fragment of her memories unfolds, she walks toward clear ocean waters.<br><br><i> Pop ,  Fizz ,  Splash ...</i> Bubbles of every color mirror bygone years, forming and bursting, bursting and forming.<br><i>\"The ocean's dearest, do you have a wish?\"<br>\"Hysilens, where are you headed?\"<br>\"Dux Gladiorum, what do you seek?\"</i><br>...<br>Homeland, revelry, the Flame-Chase... each once brilliant in her life, yet all quickly fizzing out like transient foam... Only a sigh lingers across the sky.<br>From the beginning till the end, this was all she had, in both the mortal realm and ocean depths, nothing but the fleeting traces of bubbles.<br><br><i>\"But still... how beautiful they are...\"</i><br><br><i>\"...\"<br>\"...\"<br>\"...\"</i><br><br>The dawn of Amphoreus approaches.<br>Before the final bubble bursts, she smiles, as if she has already sung everything her heart had to express beyond words."
        }
    ]
}

